import React from 'react';
import './CandidateItem.css'
const CandidatesItems = (props) => {
  return (
    <div className='Accepted-application'>
      <div className='description'>
        <h4>{props.name}</h4>


        <button>View Profile</button>
      </div>
    </div>
  );
};

export default CandidatesItems;
